import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState<string[][]>([]);

  useEffect(() => {
    const url = 'https://docs.google.com/spreadsheets/d/13IO97RPfAjQlJCYdDhIhDqYrryZz0-Gu-jbR0ZnKhZo/edit?usp=sharing';

    fetch(url)
        .then(response => response.json())
        .then(data => {
          const rows = data.feed.entry.map((entry: any) => {
            return Object.values(entry)
                .filter((value: any) => value.hasOwnProperty('gs$cell'))
                .map((cell: any) => cell.gs$cell.$t);
          }) as string[][];

          setData(rows);
        })
        .catch(error => {
          console.log(error);
        });
  }, []);

  return (
      <div>
        <h1>Donn√©es de ma feuille Google Sheets</h1>
        <ul>
          {data.map((row, index) => (
              <li key={index}>{row.join(', ')}</li>
          ))}
        </ul>
      </div>
  );
}

export default App;
